import React, { Component } from "react";
import { TextField, Container, Button } from "@material-ui/core";

class Register extends Component {
  state = {
    email: "",
    password: ""
  };

  render() {
    return (
      <div>
        <h3>REGISTER</h3>
        <Container>
          <TextField
            style={{ width: 500 }}
            label="Email"
            margin="dense"
            variant="standard"
            onChange={text => this.setState({ password: text })}
          />
          <br />
          <TextField
            style={{ width: 500 }}
            label="Passworld"
            margin="dense"
            variant="standard"
            type="password"
          />
          <br />
          <TextField
            style={{ width: 500 }}
            label="Confirm Passworld"
            margin="dense"
            variant="standard"
            type="password"
            onChange={e => this.setState({ email: e.target.value })}
          />
          <br />
          <Button
            onClick={this.handleRegister}
            style={{
              width: 500,
              marginTop: 50,
              background: "yellow",
              color: "black"
            }}
          >
            REGISTER
          </Button>
        </Container>
      </div>
    );
  }
  handleRegister() {
    console.log(this.state.email);
  }
}

export default Register;
